const Blog = ({blog, onShow}) => {

  const label = true
  
  if (onShow) {
    return (
      <div>
        <p>"{blog.title}" by {blog.author} <button onClick={onShow}>hide</button> </p>
        <p>{blog.url}</p>
        <p>{blog.likes} <button>likes</button></p>
        <p>{blog.user}</p>
      </div>
    ) 
  
  } else {
    return (
      <div>
        <p>"{blog.title}" by {blog.author} <button onClick={onShow}>view</button> </p>
      </div>
      
      )
  }  
}

export default Blog
